import React from 'react';
import { OuterWrapper, InnerWrapperFooter, P, H2 } from 'styles/MainStyles';
import styled from 'styled-components'

const Footer = () => {

    return (
    <OuterWrapper>
        <InnerWrapperFooter>
        <FooterTitle>NEWS LETTER</FooterTitle>
        <FooterText>Would you like to receive our newsletter?</FooterText>
        <label htmlFor='new-message'>
            <input
                type="input"
            //   onChange={onSetNameChange}
            //   value={newName}
              placeholder='Email'
              />
        </label>    
        <P>LINKS</P>
        <P>Book a room</P>
        </InnerWrapperFooter>
    </OuterWrapper>
    )
}

export default Footer;

const FooterTitle = styled(H2)`
color:hotpink;
`

const FooterText = styled(P)`
font-size: 16px;
text-align: center;
margin: 0;
`
